import React from 'react'

function Login() {
  return (
    <div className='container-lg container-fluid'>
      <div className='text-start'>
          <button id='btn-fill' className='my-3 rounded'><i class="bi bi-house"></i> &nbsp; Home</button>
      </div>
      Login</div>
  )
}

export default Login
